                        <path d="M233.86 458.89C335.204 458.89 417.36 453.518 417.36 446.89C417.36 440.263 335.204 434.89 233.86 434.89C132.516 434.89 50.36 440.263 50.36 446.89C50.36 453.518 132.516 458.89 233.86 458.89Z" fill="#263238"/>
